import React from 'react';
import SignInPage from './SignInPage';
import './Button.css';
import { UseNavigate } from 'react-router-dom';

const Banner = () => {
    return (
        <div style={{
            backgroundColor: 'lightBlue',
            color: '#000',
            padding: '10px',
            textAlign: 'center',
            position: 'fixed',
            top: '0',
            width: '100%',
            height: '10px',
            zIndex: '1000'
        }}>
            <button className="styled-button" onClick={UseNavigate('/signin')}>Search
            </button>
        </div>
    )
};

export default Banner;
